 can overcome a couple of variables. Variable #1 is morning precipitation and cloud cover. If we see a lot of this, the severe weather threat will be greatly minimized, because the atmosphere will not have much time to de-stabilize, therefore producing less storms. Another is  capping. A 'cap' is basically a wall in the atmosphere limiting storm development. Storms need to break through this 'cap' in order become severe. The weaker this is, the easier it is for storms to break through and go severe. The stronger this is, the less storms will break through, resulting in less severe weather. Let me just say, if we have little/no morning cloud cover, and a weak cap, we could have an outbreak. Right now, models are trending toward this, but that could change. If we are hit by one of these variables, we will likely have at least a small (level 1) severe threat, but espessialy with the way models are going, I think we will have a greater severe threat. Above is what I'm thinking for Sunday. As you can see, much of the area is under a level three severe weather threat in this. A level 4 severe weather risk may not be completely out of the question, but at this time, I think that is a very small chance. I will be monitoring this, and will share any updates.
